As suggested by y’all, here I am posting the final version of the short film “Niraivu” a small creation for Makeup artists by Makeup artists! A fun, entertaining and interesting movie with what all can happen in a wedding featuring the significance of makeup in a wedding! Hope you’d like this small creation of our makeup artists! Looking forward to your valuable feedback!!!
